import React from 'react';
import Menu from './Menu'
const MyMenu = ({ recipes }) => {
    return (
        <div className="my-menu">
            <h2>My Menu</h2>
            <ul>
                {recipes.map((recipe, index) => (
                    <li key={index}>{recipe.name}</li>
                ))}
            </ul>
        </div>
    );
};

export default MyMenu;
